<mat-paginator class="mat-paginator" hidepagesize="" showfirstlastbuttons="" sticky="always" ng-reflect-page-size="20" ng-reflect-hide-page-size="" ng-reflect-show-first-last-buttons="">
    <div class="mat-paginator-outer-container">
        <div class="mat-paginator-container">
            <!--bindings={
    "ng-reflect-ng-if": "false"
  }-->
            <div class="mat-paginator-range-actions">
                <div class="mat-paginator-range-label">1-20</div>
                <!--bindings={
    "ng-reflect-ng-if": "true"
  }--><button class="mat-paginator-navigation-first mat-icon-button mat-button-base ng-star-inserted" mat-icon-button="" type="button" ng-reflect-disabled="true" ng-reflect-position="above" ng-reflect-message="First page" aria-label="First page"
                    disabled="true">
          <span class="mat-button-wrapper"><svg 
            class="mat-paginator-icon"
              focusable="false"
              viewBox="0 0 24 24">
              <path d="M18.41 16.59L13.82 12l4.59-4.59L17 6l-6 6 6 6zM6 6h2v12H6z"></path></svg></span>
          <div
            class="mat-button-ripple mat-ripple mat-button-ripple-round"
            matripple=""
            ng-reflect-centered="true"
            ng-reflect-disabled="true"
            ng-reflect-trigger="[object HTMLButtonElement]"
          ></div>
          <div class="mat-button-focus-overlay"></div>
        </button>
                <!----><button class="mat-paginator-navigation-previous mat-icon-button mat-button-base" mat-icon-button="" type="button" ng-reflect-disabled="true" ng-reflect-position="above" ng-reflect-message="Previous page" aria-label="Previous page" disabled="true">
          <span class="mat-button-wrapper"><svg
              class="mat-paginator-icon"
              focusable="false"
              viewBox="0 0 24 24"
            >
              <path
                d="M15.41 7.41L14 6l-6 6 6 6 1.41-1.41L10.83 12z"
              ></path></svg></span>
          <div
            class="mat-button-ripple mat-ripple mat-button-ripple-round"
            matripple=""
            ng-reflect-centered="true"
            ng-reflect-disabled="true"
            ng-reflect-trigger="[object HTMLButtonElement]"
          ></div>
          <div class="mat-button-focus-overlay"></div>
        </button>
                <button class="mat-paginator-navigation-next mat-icon-button mat-button-base" mat-icon-button="" type="button" ng-reflect-disabled="false" ng-reflect-position="above" ng-reflect-message="Next page" aria-label="Next page">
          <span class="mat-button-wrapper"
            ><svg
              class="mat-paginator-icon"
              focusable="false"
              viewBox="0 0 24 24"
            >
              <path
                d="M10 6L8.59 7.41 13.17 12l-4.58 4.59L10 18l6-6z"
              ></path></svg></span>
          <div
            class="mat-button-ripple mat-ripple mat-button-ripple-round"
            matripple=""
            ng-reflect-centered="true"
            ng-reflect-disabled="false"
            ng-reflect-trigger="[object HTMLButtonElement]"
          ></div>
          <div class="mat-button-focus-overlay"></div>
        </button>
                <!--bindings={
    "ng-reflect-ng-if": "true"
  }--><button class="mat-paginator-navigation-last mat-icon-button mat-button-base ng-star-inserted" mat-icon-button="" type="button" ng-reflect-disabled="false" ng-reflect-position="above" ng-reflect-message="Last page" aria-label="Last page">
          <span class="mat-button-wrapper"
            ><svg
              class="mat-paginator-icon"
              focusable="false"
              viewBox="0 0 24 24"
            >
              <path
                d="M5.59 7.41L10.18 12l-4.59 4.59L7 18l6-6-6-6zM16 6h2v12h-2z"
              ></path></svg></span>
          <div
            class="mat-button-ripple mat-ripple mat-button-ripple-round"
            matripple=""
            ng-reflect-centered="true"
            ng-reflect-disabled="false"
            ng-reflect-trigger="[object HTMLButtonElement]"
          ></div>
          <div class="mat-button-focus-overlay"></div>
        </button>
                <!---->
            </div>
        </div>
    </div>
</mat-paginator>
